import React, { useEffect, useState } from 'react';
import { getLeads, deleteLead, updateLead } from '../api';

export default function LeadList({ refreshKey }) {
  const [leads, setLeads] = useState([]);
  const [loading, setLoading] = useState(true);
  const [q, setQ] = useState('');

  const fetch = async () => {
    try {
      setLoading(true);
      const res = await getLeads({ q });
      setLeads(res.data.data || res.data);
    } catch (err) {
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetch();
  }, [refreshKey]);

  const remove = async (id) => {
    if (!window.confirm('Delete lead?')) return;
    await deleteLead(id);
    setLeads(leads.filter((l) => l._id !== id));
  };

  const changeStatus = async (id, status) => {
    const res = await updateLead(id, { status });
    setLeads(leads.map((l) => (l._id === id ? res.data : l)));
  };

  if (loading) return <div className="p-4 text-center">Loading...</div>;

  return (
    <div className="bg-white p-6 rounded-lg shadow-md">
      <div className="flex gap-2 mb-4">
        <input
          placeholder="Search name/email/phone"
          value={q}
          onChange={(e) => setQ(e.target.value)}
          className="flex-grow p-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-green-500"
        />
        <button
          onClick={fetch}
          className="px-4 py-2 bg-green-500 hover:bg-green-600 rounded-md text-white font-semibold transition"
        >
          Search
        </button>
      </div>
      <table className="w-full border-collapse border border-gray-200 text-left">
        <thead>
          <tr className="bg-gray-100">
            <th className="border border-gray-200 px-4 py-2">Name</th>
            <th className="border border-gray-200 px-4 py-2">Email</th>
            <th className="border border-gray-200 px-4 py-2">Phone</th>
            <th className="border border-gray-200 px-4 py-2">Source</th>
            <th className="border border-gray-200 px-4 py-2">Status</th>
            <th className="border border-gray-200 px-4 py-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {leads.map((lead) => (
            <tr key={lead._id} className="hover:bg-gray-50">
              <td className="border border-gray-200 px-4 py-2">{lead.name}</td>
              <td className="border border-gray-200 px-4 py-2">{lead.email}</td>
              <td className="border border-gray-200 px-4 py-2">{lead.phone}</td>
              <td className="border border-gray-200 px-4 py-2">{lead.source}</td>
              <td className="border border-gray-200 px-4 py-2">
                <select
                  value={lead.status}
                  onChange={(e) => changeStatus(lead._id, e.target.value)}
                  className="rounded border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-400 p-1"
                >
                  <option>New</option>
                  <option>Contacted</option>
                  <option>Qualified</option>
                </select>
              </td>
              <td className="border border-gray-200 px-4 py-2">
                <button
                  onClick={() => remove(lead._id)}
                  className="px-3 py-1 bg-red-500 hover:bg-red-600 rounded text-white transition"
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
